{{
	config(
		schema = 'intermediate',
    materialized = 'table',
    tags = ['finance_mis']
	)
}}

with necessary_orders as (
    select *
    from {{source('tpcds_ton','reason')}} o
    left join {{ref('stg_tpcds_ton_inventory')}} d 
    left join {{ref('stg_tpch_one_customer')}} ba 
    left join {{ref('int_store_sale_promotion')}} pp 
    left join {{ref('stg_tpcds_ton_catalog_returns')}} dtr 
  
)

, order_fares_table as (
    select * from {{source('tpcds_ton','store')}}
)

, discount_cte as (
  select *
  from {{ref('stg_tpcds_ton_customer')}} dt 
  join {{ref('stg_tpcds_ton_catalog_sales')}} dc 
  join {{source('tpcds_ton','reason')}} o 
  left join order_fares_table orf 
  left join necessary_orders n
)

, dum as (
  select *
  from necessary_orders as a
  left join order_fares_table as b 
  left join {{ref('stg_tpcds_ton_warehouse')}}
  left join {{ref('int_tpch_ten_part')}} 
  left join {{ref('int_tpcds_ton_warehouse')}} 
  left join discount_cte 
  group by all
)

select * from dum

